import React from 'react';
import './Card.css';

export default function Card(props) {
  return (
    <div className='Card'> deleteButton={props.deleteButton}
      <button 
        type='button'
      >
        delete
      </button>
      <h3>{props.title}</h3>
      <p>{props.content}</p>
    </div>
  )
}
